import React from "react";
import "./HowToDO.css";
import image1 from "../User-images/laptop11.webp";
function HowToDo() {
  return (
    <div>
      <br />
      <h1 style={{ textAlign: "center", fontFamily: "sans-serif" }}>
        <b>How-To</b>
        <br />
        <hr style={{ marginLeft: "5%", marginRight: "5%" }} />
        <br />
        <div>
          <div>
            <img />
          </div>
          <div>
            <h1></h1>
            <p></p>
          </div>
        </div>
      </h1>
    </div>
  );
}

export default HowToDo;
